import React from 'react';

import './DrawerToggle.css'

const DrawerToggle = props => (
    <div>
    <button className="toggle-button" onClick={props.click} >
          <div className="toggle-button-line" />
          <div className="toggle-button-line" />
          <div className="toggle-button-line" />
    </button>

    <button></button>
    </div>
);

export default DrawerToggle
